import React from 'react';
import { View, Text, Image, Button, Pressable } from 'react-native';
import { useNavigation } from '@react-navigation/native'; // Importation pour l'objet navigation

// ... autres imports et styles

export const WelcomeScreen = () => {
  const navigation = useNavigation(); // Accès à l'objet navigation

  const onPressConnexion = () => {
    navigation.navigate('SignInScreen'); // Utiliser le bon nom d'écran
  };

  const onPressInscription = () => {
    navigation.navigate('SignUpScreen'); // Utiliser le bon nom d'écran
  };

  return (
    <View style={styles.container}>
      {/* ... le reste de votre code */}
      <Pressable style={styles.buttonPush} onPress={onPressConnexion}>
        <Text>Se connecter</Text>
      </Pressable>
      <Pressable style={styles.buttonPush} onPress={onPressInscription}>
        <Text>S'inscrire</Text>
      </Pressable>
    </View>
  );
};
